import React from 'react'
import './Preview.css'
import dribble from './dribble.png'

class Preview extends React.Component {
    render () {
        return (
            <div className="preview">
                <div className="previewImage"></div>
                {/* <img src={this.props.og.ogImage[0].url} alt="url image" /> */}
                    <img src={dribble} alt="dribble png" />
                <div className="PreviewTitle">
                hello hello hello helloe this is the title of the preview title
                </div>
                <div className="PreviewDes"></div>
            </div>
        )
    }
}

export default Preview
